import React, { Component } from "react";
import Navigation from "./component/navigation/Navigation";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Presentationlist from "./component/presentationlist/Presentationlist";
import Viewpresentation from "./component/viewpresentation/Viewpresentation";

import "./App.css";

class App extends Component {
  state = {
    posts: [
      {
        id: 1,
        presentatorname: "Anuj Thapa",
        evaluatorname: "Kushal Kushal",
        topic: "Index",
        url: "https://reactjs.org/docs/state-and-lifecycle.html"
      },
      { id: 2, presentatorname: "David David" }
    ]
  };

  render() {
    return (
      <div className="App">
        <Router>
          <div className="body">
            <Navigation />
            <Switch>
              <Route exact path="/" component={props => <Presentationlist />} />
              <Route
                path="/addpresentation"
                component={props => <Viewpresentation />}
              />
            </Switch>
          </div>
        </Router>
      </div>
    );
  }
}

export default App;
